import React from 'react'
import main from "./main.jpg"
// img: "img/product-1.png",

const Header = () => {
  return (
    <HeadWrap>
   <img className='main-pic' src={main} alt="Logo" />;
    </HeadWrap>
  )
}

const HeadWrap = styled.nav `
    .main-pic {
      height: 100vh;
    }
    
`;



export default Header;
